import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import UserDashboard from './components/dashboard/UserDashboard';
import MaintainerDashboard from './components/dashboard/MaintainerDashboard';
import FieldHeadDashboard from './components/dashboard/FieldHeadDashboard';
import History from './components/dashboard/History';
import ReportForm from './components/reports/ReportForm';
import ReportList from './components/reports/ReportList';
import AllReports from './components/reports/AllReports';
import ReportDetails from './components/reports/ReportDetails';
import Header from './components/common/Header';
import Footer from './components/common/Footer';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Header />
          <main>
            <Routes>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/user-dashboard" element={<UserDashboard />} />
              <Route path="/maintainer-dashboard" element={<MaintainerDashboard />} />
              <Route path="/fieldhead-dashboard" element={<FieldHeadDashboard />} />
              <Route path="/history" element={<History />} />
              <Route path="/report-form" element={<ReportForm />} />
              <Route path="/reports" element={<ReportList />} />
              <Route path="/all-reports" element={<AllReports />} />
              <Route path="/report/:id" element={<ReportDetails />} />
              <Route path="/" element={<Login />} />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
